/* eslint-disable react-hooks/exhaustive-deps */
/* eslint-disable jsx-a11y/alt-text */
/* eslint-disable jsx-a11y/anchor-is-valid */
import React, { useEffect, useState } from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import { Pagination, Navigation } from 'swiper/modules';
import * as ScrollArea from '@radix-ui/react-scroll-area';
import axios from "axios"
import 'swiper/css';
import 'swiper/css/pagination';
import 'swiper/css/navigation';
import { useParams } from "react-router-dom";


function ClubDetail() {

    let { id } = useParams();
    const [clubData, setClubData] = useState({});

    useEffect(() => {
        axios.get(`http://192.168.1.29:4000/club/about/${id}`)
            .then(function (response) {
                return response.data;
            })
            .then((data) => {
                setClubData(data);
            })
            .catch((error) => console.error(error));
    }, [])


    return (
        <div className='container-md'>
            <section class="text-white body-font">
                <div class="container px-5 py-24 mx-auto">
                    <div class="flex flex-wrap w-full mb-20">
                        <div class="lg:w-1/2 mb-6 lg:mb-0 flex gap-2 align-center flex-col lg:flex-row">
                            <span className='w-28'>
                                <img className='rounded-full object-center' src={clubData.img} />
                            </span>
                            <h1 class="sm:text-4xl text-2xl font-medium title-font mb-2 text-white text-center grid align-center">
                                {clubData.name} Kulübü
                            </h1>
                        </div>
                        <p class="lg:w-1/2 w-full leading-relaxed text-white">
                            {clubData.description}
                        </p>
                    </div>
                    <Swiper
                        pagination={{
                            type: 'progressbar',
                        }}
                        navigation={true}
                        modules={[Pagination, Navigation]}
                        className="mySwiper"
                        lazy={true}
                    >
                        <SwiperSlide>
                            <img lazy className='object-fit' src="https://iabaustralia.com.au/wp-content/uploads/2023/06/June-Event-2023.png" />
                        </SwiperSlide>
                        <SwiperSlide>
                            <img lazy className='object-fit' src="https://iabaustralia.com.au/wp-content/uploads/2023/06/June-Event-2023.png" />
                        </SwiperSlide>
                        <SwiperSlide>
                            <img lazy className='object-fit' src="https://iabaustralia.com.au/wp-content/uploads/2023/06/June-Event-2023.png" />
                        </SwiperSlide>
                        <SwiperSlide>
                            <img lazy className='object-fit' src="https://iabaustralia.com.au/wp-content/uploads/2023/06/June-Event-2023.png" />
                        </SwiperSlide>
                    </Swiper>
                </div>
            </section>
            <ScrollArea.Root className="rounded overflow-hidden shadow-[0_2px_10px] shadow-blackA7 bg-slate-800 m-5">
                <ScrollArea.Viewport className="w-full h-full rounded">
                    <div className="py-[15px] px-5">
                        <div className="text-red-600 text-[15px] leading-[18px] font-medium">
                            Kulüp Üyeleri
                        </div>
                        {clubData.participants.map((participant, index) => (
                            <div
                                className="text-white text-[13px] leading-[18px] mt-2.5 pt-2.5 border-t border-t-slate-900"
                            >
                                {participant.email === clubData.owner.email && (<a className='text-red-600'>(Başkan) </a>)}
                                {participant.name}
                            </div>
                        ))}
                    </div>
                </ScrollArea.Viewport>
                <ScrollArea.Scrollbar
                    className="flex select-none touch-none p-0.5 bg-blackA6 transition-colors duration-[160ms] ease-out hover:bg-blackA8 data-[orientation=vertical]:w-2.5 data-[orientation=horizontal]:flex-col data-[orientation=horizontal]:h-2.5"
                    orientation="vertical"
                >
                    <ScrollArea.Thumb className="flex-1 bg-mauve10 rounded-[10px] relative before:content-[''] before:absolute before:top-1/2 before:left-1/2 before:-translate-x-1/2 before:-translate-y-1/2 before:w-full before:h-full before:min-w-[44px] before:min-h-[44px]" />
                </ScrollArea.Scrollbar>
                <ScrollArea.Scrollbar
                    className="flex select-none touch-none p-0.5 bg-blackA6 transition-colors duration-[160ms] ease-out hover:bg-blackA8 data-[orientation=vertical]:w-2.5 data-[orientation=horizontal]:flex-col data-[orientation=horizontal]:h-2.5"
                    orientation="horizontal"
                >
                    <ScrollArea.Thumb className="flex-1 bg-mauve10 rounded-[10px] relative before:content-[''] before:absolute before:top-1/2 before:left-1/2 before:-translate-x-1/2 before:-translate-y-1/2 before:w-full before:h-full before:min-w-[44px] before:min-h-[44px]" />
                </ScrollArea.Scrollbar>
                <ScrollArea.Corner className="bg-blackA8" />
            </ScrollArea.Root>
        </div>
    )
}

export default ClubDetail
